pr_body:
This PR makes the xtimec.h and xthreads.h headers textual in std_msvc.modulemap.

This is required as including xtimec.h and xthreads.h cause problems on newer Windows SDKs.

@vgvassilev @bellenot

This PR fixes the errors occurring while building the Thread module on Windows by adding a new services_msvc.modulemap which holds Microsoft System Services headers.
```
/.../build/include\TWin32Condition.h(35,4): error G4823F0AC: declaration of 'CRITICAL_SECTION' must be imported from module 'Core.TWinNTSystem.h' before it is required [C:\build\night\LABEL\windows10\SPEC\rtcxxmod\build\core\thread\G__Thread.vcxproj]
     CRITICAL_SECTION waiters_count_lock_;
     ^
  C:\Program Files (x86)\Windows Kits\10\Include\10.0.18362.0\um\minwinbase.h:217:30: note: previous declaration is here
  typedef RTL_CRITICAL_SECTION CRITICAL_SECTION;
                               ^
```

@vgvassilev @bellenot

On Windows, the .dll files contain symbol information in COFF Format which DLM currently fails to understand properly. This leads to unrecognized symbol errors while starting ROOT with modules.

This commit teaches DLM to correctly read symbols when the Object File is in COFF executable format.

@vgvassilev @bellenot

